// src/components/BlogPosts.js
import React from 'react';

const blogs = [
  {
    id: 1,
    title: 'React Hooks: A Deep Dive',
    author: 'John Doe',
    content:
      'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.',
    imageUrl: 'https://example.com/react-hooks-image.jpg',
  },
  {
    id: 2,
    title: 'Exploring ES6 Features',
    author: 'Jane Smith',
    content:
      'Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',
    imageUrl: 'https://example.com/es6-features-image.jpg',
  },
  // Add more blog entries as needed
];

const BlogPosts = () => {
  return (
    <div>
      <h2>Blog Posts</h2>
      <ul className="list-unstyled">
        {blogs.map((blog) => (
          <li key={blog.id} className="media my-4">
            <img
              src={blog.imageUrl}
              className="mr-3"
              alt={blog.title}
              style={{ width: '100px', height: '100px' }}
            />
            <div className="media-body">
              <h5 className="mt-0">{blog.title}</h5>
              <p>
                <strong>Author:</strong> {blog.author}
              </p>
              <p>{blog.content}</p>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BlogPosts;
